import React, { Component } from "react";
import Button, {Layout} from '@material-ui/core/Button';
import { Grid } from "@material-ui/core";

export default class extends Component {
  render() {
    return (
    <Layout>
      <Grid container spacing={32}>
      <Grid className={head}> 
      {t('this is head of page')}

      </Grid>
      <Grid className={body}>
      {t('this is body of page')}
      </Grid>

      </Grid>

    </Layout>
    )
  }

}
